  \"Rice Lake National Wildlife Refuge (including Mille Lacs and Sandstone): Annual
  narrative report: Calendar year 1985\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  5,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:55:43.838630\",\n\t\"name\": \"rice-lake-national-wildlife-refuge-including-mille-lacs-and-sandstone-annual-narrative-rep\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rice Lake
  NWR and Mille Lacs NWR outlines Refuge accomplishments during the 1985 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, public participation, compliance with environmental and cultural
  resource mandates, and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, manpower programs, volunteer programs,
  funding, safety, and technical assistance is given. Habitat management is also covered;
  subjects include wetlands, forests, croplands, grasslands, grazing, haying, fire
  management, pest control, and wilderness areas. The wildlife section of the report
  discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, fisheries resources, animal control, marking
  and bird banding, and disease control. The public uses of the Refuge described in
  this report include outdoor classrooms, interpretive programs, hunting, fishing,
  wildlife observation, outdoor recreation, and law enforcement. The equipment and
  facilities section of the report provides information about new construction, rehabilitation,
  major maintenance, equipment replacement, computer systems, and energy conservation.
  Cooperative programs and items of interest are provided at the end. Refuge brochures,
  newspaper articles, and field guides are attached.\",\n\t\"license_title\": \"License
